        <>
        <header className={classes.header}>
            <h1>ReactMeals</h1>
            <HeaderCartButton />
        </header>

        <div className={classes['main-image']}>
            <img  src={melaImages} alt="This is an Image of table with food items"/>
        </div>

        </>
    )
}

export default Header;
